cim:FunctionDescriptor.cim:FunctionDescriptor.equation:
model FSM_Frequency_Response

equation
	dP = Select((df<0), (-100/s1*df), (Select((df>0), (-100/s2*df), 0)));
end FSM_Frequency_Response;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

model FSM_Limiter

equation
	yout = Lim(yin,(ymin/100),(ymax/100));

end FSM_Limiter;

function Lim
	input Real x;
	input Real minLim;
	input Real maxLim;
	output Real yo;
algorithm
	if x < minLim then
		yo = minLim;
	else if x > maxLim then
		yo = maxLim;
	else
		yo = x;
	end if;
end Lim;

