Real dP (start = 0);
if noEvent(abs(f_fast_remote))) < 1e-6 then
    f_fast_remote = fn;
end if;
if noEvent(abs(f_slow_remote))) < 1e-6 then
    f_slow_remote = fn_remote;
end if;
if noEvent(abs(fn_remote))) < 1e-6 then
    fn_remote = f_fast_remote;
end if;
