model FSM_Logic_Embbeded_HVDC

equation
	logic = Select(Mode_embedded  and ((df>0  and df_remote<=0  and abs(df)>abs(df_remote)) or  (df<0  and df_remote>=0  and abs(df)>abs(df_remote))), 1,0);
	activate = Selfix(Mode_embedded, Picdro(logic-0.499, 0.001, 0.001), 1);
end FSM_Logic_Embbeded_HVDC;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function Picdro
	input Boolean boolexpr;
	input Real Tpick;
	input Real Tdrop;
	output Boolean varA;
algorithm
	if boolexpr = true then
		varA = delay(1,Tpick);
	else if boolexpr = false then
		varA = delay(0,Tdrop);
	else
		varA = pre(varA)
	end if;
end Picdro;

