model FSM_First_order_lag_(PT1)

equation
	// First order lag block with time constant T
	// if T=0, block is bypassed (yo=yi)

	der(x) = Selfix((T>0), ((yi-x)/T), 0.0);
	yo = Selfix((T>0), x, yi);
end FSM_First_order_lag_(PT1);

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

model FSM_Deadband

equation
	f_in = Selfix(FSM_on, f, fn);
	f_under = Picdro((fn+(f_db1/1000))-f_in+0.5, Selfix(Mode_Db, delay_init, 999999), 0.0) // f<(fn-f_db)
	f_over  = Picdro(f_in-(fn+(f_db2/1000))+0.5, Selfix(Mode_Db, delay_init, 999999), 0.0) // f>(fn+f_db)
	df = Selfix(FSM_on, Selfix(Mode_Db, Select(f_under, ((f_in-(fn+(f_db1/1000)))/fn), (Select(f_over, (f_in-(fn+(f_db2/1000)))/fn, 0))), Select((f_in-fn)<-0.0000001, (f_in-fn+0.0000001)/fn, Select((f_in-fn)>0.0000001, (f_in-fn-0.0000001)/fn,0))), 0);                                  

end FSM_Deadband;

