	f_under  = Picdro(f2-f_in+0.5, delay_init, 0.1);    // f<f2
	df = Selfix(LFSMU_on, Select(f_under, min((f_in-f2)/fn, 0.0), 0), 0); 

end FSM_LFSM-U_Activation;

